import React, { useState } from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  const [loggedIn, setLoggedIn] = useState(false);

  const handleLogin = () => {
    // Logic for logging in goes here
    setLoggedIn(true);
  };

  const handleLogout = () => {
    // Logic for logging out goes here
    setLoggedIn(false);
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">
            Full Stack Application
          </Link>

          {loggedIn ? (
            <Link className="btn btn-outline-light" to="/userLogOut">
              Logout
            </Link>
          ) : (
            <Link className="btn btn-outline-light" to="/userLogIn">
              Login
            </Link>
          )}
          <Link className="btn btn-outline-light mx-2" to="/adduser">
            Add User
          </Link>
        </div>
      </nav>
    </div>
  );
}
